import React from 'react';
import '../css/auth-error.scss';
import inputErrorIcon from '../img/input-error-icon.svg';

const AuthError = props => {
  
  for (let key in props.error.registerErrors) {
    console.log(props.error.registerErrors[key]);
    }

  const errors = [

    <li className="auth-error-list__item">
    <div className="auth-error-wrapper">
      <img
        className="auth-error-wrapper__input-status"
        src={inputErrorIcon}
        alt="Input Status Icon"
      />
      <p className="auth-error-wrapper__text">Username is required</p>
    </div>
    </li>
  ];

  return (
    <div className="auth-error">
      <p className="auth-error__message">Please fix the following errors:</p>
      <ul className="auth-error-list">
        {errors}
      </ul>
    </div>
  );
};

export default AuthError;
